import { Container } from "../components/Grid";
import { Input, FormBtn  } from "../components/Form";
// import Script from 'react-load-script'

class Result extends Component {

    componentDidMount () {
        const script = document.createElement("script");
        script.type = 'text/javascript';
        script.src = "https://widget.budgetyourtrip.com/location-widget-js/US&defaultcurrency=USD";
        // script.async = false;
        document.getElementsByTagName('head')[0].appendChild(script);

    }

    shouldComponentUpdate() {
        return false;
    }



  render() {
    return (


      <Container>

          <form>
          <Input
                // value={this.state.name}
                // onChange={this.handleInputChange}
                name="name"
                placeholder="What is your name? (Required)"
              />

          </form>



  <a href="https://www.budgetyourtrip.com/united-states-of-america" 
   class="budgetyourtrip-logo-pushdown" 
  rel="noopener">United States of America Travel Costs</a>
             <FormBtn
                disabled={!(this.state.city && this.state.name && this.state.info)}
                onClick={this.handleFormSubmit}
              >
                Submit 
              </FormBtn>



      </Container>



    );
  }
}

export default Result;
